<script type="text/javascript">
    window.addEventListener('load', function (event) {
        angular.module('test-player-session-login').constant('AppConfig',
                {
                    frontEndHost:        "test.mapnwea.org",
                    nweaAPIHost:         "https://api.nwea.org",
                    proctorAPIHost:      "https://test.mapnwea.org",
                    stateTestPlayerRedirect: "https://testplayer.mapnwea.org/",
                    studentResourcesUrl: "https://studentresources.nwea.org",
                    urlWhiteList:        ["'self'","'*.mapnwea.org/**'"]
                }
        );
    });
</script>
<div id="nwea-low-level-loading" class="nwea-low-level-loading">
    <div class="loading">
        <h1></h1>
    </div>
</div>
<div id="nwea-low-level-error" class="nwea-low-level-error">
    <div class="error-content">
        <div class="header">
            <div aria-hidden="true" class="left">
                <img class="icon" src=""/>
            </div>
            <div class="right">
                <h1 class="language-1">
                    Please raise your hand for help.
                </h1>
                <h2 class="language-2" lang="es">
                    Por favor levante la mano para pedir ayuda.
                </h2>
            </div>
        </div>
        <div class="primary">
            We were unable to load the application.<br/>
            Please retry or exit.
        </div>
        <div class="buttons">
            <button id="nwea-low-level-error-button-retry"
                    class="nwea__button__base nwea__button__aaa nwea__button__blue nwea__button__solid">
                <span>try again</span>
            </button>
            <button id="nwea-low-level-error-button-exit"
                    class="nwea__button__base nwea__button__aaa nwea__button__blue nwea__button__outline">
                <span>exit</span>
            </button>
        </div>
    </div>
</div>
<div id="nwea-low-level-content" class="nwea-low-level-content">
        <div id="ng-app">
            <div data-ng-cloak data-ng-view id="join-test-session"></div>
        </div>
</div>
